import React from 'react'
import { Link } from 'react-router-dom'

const BizIndex = ({ organizations }) => {
  // console.log(props.organizations);
  return(
    <div className="paracenter">
      {
        organizations.map(organization => (
        <h3><Link to={`/${card.title}`} className='ui header'>{card.title}</Link>{organization.name}<br />
        {organization.phone}<br />
        {organization.website}</h3>
        ))
      }
    </div>
  );
}

export default BizIndex
